import React from "react";
import './Nav.css'

function Nav (){
    return ( 
        <div class="topnav">
            <p >Usuarios </p>
            <p >Proyectos</p>
            <p >Profesores</p>
            <p >Lideres</p>
        </div>
    )
} 

export default Nav;
